import React, { Fragment } from "react";
import { Container } from "react-bootstrap";
import { Image } from "react-bootstrap";
import { Navbar } from "react-bootstrap";
import { Nav } from "react-bootstrap";
import { Button } from "react-bootstrap";
import { CardGroup } from "react-bootstrap";
import CardComp from "../components/CardComp";

export default function Profile() {
    return (
        <Fragment>
            <Container id="ContainerMainPage">
                <div id="profileinfo">
                    <Image id="profile" src="https://i.pinimg.com/originals/6c/0f/56/6c0f56bbe60aa6c72f384215326a0ca3.jpg" />
                    <p id="username">UserName</p>
                    <Button className="btnEntrar" variant="light">Editar</Button>
                </div>
                <Navbar id="LogNavbar" variant="dark" expand="lg">
                    <Container>
                        <Nav className="me-auto">
                            <Nav.Link href="/Profile">Likes</Nav.Link>
                            <Nav.Link href="/Lists">Listas</Nav.Link>
                            <Nav.Link href="/Following">Seguidos</Nav.Link>
                            <Nav.Link href="/Followers">Seguidores</Nav.Link>
                        </Nav>
                    </Container>
                </Navbar>
                <hr className="hr"></hr>
                <CardGroup>
                    <CardComp name="Dune" img="https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/a58a7719-0dcf-4e0b-b7bb-d2b725dbbb8e/denr9lw-2ceb9359-60d1-47f8-975a-802963088d4e.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..tdTbtAz_4gaRAUULq2dHWJM6NnbosnJAyoGDmfQeh0s" />
                </CardGroup>
            </Container>
        </Fragment>
    );
}
